sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = "";

  try {
    var sysId = inputs.query_sysid.trim();
    var qGr = new GlideRecord('x_snc_meetup_com_query');
    if (!qGr.get(sysId)) {
      gs.error('Cannot read record:[' + sysId + ']');
    }

    var myQuery = qGr.getValue('query');
    myQuery = myQuery.replace(/"/g, "\\\"");
    myQuery = myQuery.replace(/[\n\r\t]/g, '')

    gs.info('>>>q=' + myQuery + '\nVariables=' + inputs.variables);

    var r = new sn_ws.RESTMessageV2('x_snc_meetup_com.Meetup Spoke GQL', 'GQL');
    r.setStringParameterNoEscape('query', myQuery);
    r.setStringParameterNoEscape('variables', myVariables);

    var response = r.execute();
    var responseBody = response.getBody();
    var httpStatus = response.getStatusCode();
    gs.info(responseBody);
  }
  catch(ex) {
    var message = ex.message;
  }

  outputs.responsebody = responseBody;
  outputs.httpstatus = httpStatus;
})(inputs, outputs);

