sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = "";
  gs.info('>>>q=' + inputs.query);

  try { 
    var r = new sn_ws.RESTMessageV2('x_snc_meetup_com.Meetup Spoke GQL', 'GQL');
    r.setStringParameterNoEscape('query', inputs.query);

    var response = r.execute();
    var responseBody = response.getBody();
    var httpStatus = response.getStatusCode();
    gs.info(responseBody);
  }
  catch(ex) {
    var message = ex.message;
  }

  outputs.responsebody = responseBody;
  outputs.httpstatus = httpStatus;
})(inputs, outputs);

